import {useAuth} from '../utils/auth';
import { Navigate } from 'react-router-dom';
export const RequireAuth = ({children}) =>
{
    const auth = useAuth()
    let navigate = useNavigate();

    if (!auth.user)
    {
        return <Navigate to="/login" />;
    }

    console.log(auth.user)
    navigate('/login');

    
}
